import React, { useState } from 'react';
import './OrderForm.css';

interface OrderFormProps {
  addOrder: (order: { price: string, quantity: string }, side: 'bids' | 'asks') => void;
}

const OrderForm: React.FC<OrderFormProps> = ({ addOrder }) => {
  const [price, setPrice] = useState<string>('');
  const [quantity, setQuantity] = useState<string>('');
  const [side, setSide] = useState<'bids' | 'asks'>('bids');

  const handleSubmit = (event: React.FormEvent) => {
    event.preventDefault();
    if (!price || !quantity) {
      alert('Please enter valid price and quantity');
      return;
    }
    addOrder({ price, quantity }, side);
    setPrice('');
    setQuantity('');
  };

  return (
    <form className="OrderForm" onSubmit={handleSubmit}>
      <h2>Add Order</h2>
      <div>
        <label>
          Price:
          <input
            type="number"
            value={price}
            onChange={(e) => setPrice(e.target.value)}
            required
          />
        </label>
      </div>
      <div>
        <label>
          Quantity:
          <input
            type="number"
            value={quantity}
            onChange={(e) => setQuantity(e.target.value)}
            required
          />
        </label>
      </div>
      <div>
        <label>
          Side:
          <select value={side} onChange={(e) => setSide(e.target.value as 'bids' | 'asks')}>
            <option value="bids">Buy</option>
            <option value="asks">Sell</option>
          </select>
        </label>
      </div>
      <button type="submit">Submit Order</button>
    </form>
  );
};

export default OrderForm;
